import React, { Component } from "react";
import { Redirect } from "react-router-dom";

class Game extends Component {
  constructor(props) {
    super(props);
    this.state = {
      id: props.id,
      name: props.name,
      availableIn: props.availableIn,
      status: props.status,
      noAvailable: props.noAvailable,
      redirect: false
    };

    this.setRedirect = this.setRedirect.bind(this);
  }
  setRedirect = () => {
    console.log("Test");
    this.setState({
      redirect: true
    });
  };

  renderRedirect = () => {
    if (this.state.redirect) {
      return <Redirect to={"/games/" + this.state.id} />;
    }
  };
  render() {
    return (
      <tr onClick={this.setRedirect} id={this.state.id}>
        {this.renderRedirect()}
        <td>{this.state.id}</td>
        <td>{this.state.name}</td>
        <td>
          {this.state.availableIn.map(gameingConsole => gameingConsole + " ")}
        </td>
        <td>{this.state.status}</td>
        <td>{this.state.noAvailable}</td>
      </tr>
    );
  }
}

export default Game;
